import React  , {useState} from "react";
import { useDispatch, useSelector } from "react-redux";
import _ from "lodash";
import { GetUserList } from "../actions/UserActions";
const UserList = () => {
  const dispatch = useDispatch();
  const userList = useSelector((state) => state.UserList);
  React.useEffect(() => {
    FetchData();
  }, []);
  const [value, setValue] = useState(0);
  const [msg, setMsg] = useState("3aslama ");
  const sumbitClick = () => {
    setValue(value + 1);
  };
  React.useEffect(() => {
    setMsg(msg+" 3aslama ");
  }, [value]);
  const FetchData = () => {
    dispatch(GetUserList());
  };
  const ShowData = () => {
    if (!_.isEmpty(userList.data)) {
      return userList.data.map((item) => {
        return <div key={item.id}>{item.email}</div>;
      });
    }
    if (userList.loading) {
      return <p>Loading...</p>;
    }
    if (userList.errorMsg !== "") {
      return <p>{userList.errorMs}</p>;
    }
    return " unable to get data ";
  };
  return (
    <div>
      {ShowData()}
      <button onClick={() => sumbitClick()}>{msg}</button>
    </div>
  );
};

export default UserList;
